SELECT  DateMatch, Sport, ClubName AS HomeClub, Team AS HomeTeam,
(SELECT ClubName FROM [Sport].[dbo].[Clubs] WHERE [Sport].[dbo].[Matches].[AwayClubID] = [Sport].[dbo].[Clubs].[ClubID]) AS AwayClub,
(SELECT Team FROM [Sport].[dbo].[Teams] WHERE [Sport].[dbo].[Matches].[AwayTeamID] = [Sport].[dbo].[Teams].[TeamID]) AS AwayTeam,
TournamentName
FROM [Sport].[dbo].[Matches]
JOIN [Sport].[dbo].[Sport] ON [Sport].[dbo].[Matches].[SportID] = [Sport].[dbo].[Sport].[SportID]
JOIN [Sport].[dbo].[Clubs] ON [Sport].[dbo].[Matches].[HomeClubID] = [Sport].[dbo].[Clubs].[ClubID]
JOIN [Sport].[dbo].[Teams] ON [Sport].[dbo].[Matches].[HomeTeamID] = [Sport].[dbo].[Teams].[TeamID] 
JOIN [Sport].[dbo].[Tournaments] ON [Sport].[dbo].[Matches].[MatchId] = [Sport].[dbo].[Tournaments].[MatchId] 

CREATE VIEW MarchList AS
SELECT TOP (10)
  ROW_NUMBER() OVER(ORDER BY DateMatch ASC) AS ID,
   DateMatch, Sport, ClubName AS HomeClub, Team AS HomeTeam,
   (SELECT ClubName FROM [Sport].[dbo].[Clubs] WHERE [Sport].[dbo].[Matches].[AwayClubID] = [Sport].[dbo].[Clubs].[ClubID]) AS AwayClub,
   (SELECT Team FROM [Sport].[dbo].[Teams] WHERE [Sport].[dbo].[Matches].[AwayTeamID] = [Sport].[dbo].[Teams].[TeamID]) AS AwayTeam,
   TournamentName
   FROM [Sport].[dbo].[Matches]
   JOIN [Sport].[dbo].[Sport] ON [Sport].[dbo].[Matches].[SportID] = [Sport].[dbo].[Sport].[SportID]
   JOIN [Sport].[dbo].[Clubs] ON [Sport].[dbo].[Matches].[HomeClubID] = [Sport].[dbo].[Clubs].[ClubID]
   JOIN [Sport].[dbo].[Teams] ON [Sport].[dbo].[Matches].[HomeTeamID] = [Sport].[dbo].[Teams].[TeamID] 
   JOIN [Sport].[dbo].[Tournaments] ON [Sport].[dbo].[Matches].[MatchId] = [Sport].[dbo].[Tournaments].[MatchId] 

SELECT TOP (50)*
FROM [Sport].[dbo].[Matches]
WHERE DateMatch BETWEEN '2018-09-01' AND '2018-09-30'

UPDATE Tournaments
SET TournamentName = 'National Football League'
WHERE TournamentName = 'NFL'

SELECT *
FROM [Sport].[dbo].[Tournaments]
