SELECT  DateMatch, ClubName AS HomeClub, Team AS HomeTeam,
(SELECT Team FROM [Sport].[dbo].[Clubs] WHERE [Sport].[dbo].[Matches].[AwayClubID] = [Sport].[dbo].[Clubs].[ClubID]) AS AwayClub,
(SELECT Team FROM [Sport].[dbo].[Teams] WHERE [Sport].[dbo].[Matches].[AwayTeamID] = [Sport].[dbo].[Teams].[TeamID]) AS AwayTeam,
TournamentName
FROM [Sport].[dbo].[Matches]
JOIN [Sport].[dbo].[Clubs] ON [Sport].[dbo].[Matches].[HomeClubID] = [Sport].[dbo].[Clubs].[ClubID]
JOIN [Sport].[dbo].[Teams] ON [Sport].[dbo].[Matches].[HomeTeamID] = [Sport].[dbo].[Teams].[TeamID] 
JOIN [Sport].[dbo].[Tournaments] ON [Sport].[dbo].[Matches].[MatchId] = [Sport].[dbo].[Tournaments].[MatchId] 
WHERE DateMatch < '2018-09-10' AND Team LIKE '%18/19%'


