SELECT  ClubName AS HomeClub,
(SELECT ClubName FROM [Sport].[dbo].[Clubs] WHERE [Sport].[dbo].[Matches].[AwayClubID] = [Sport].[dbo].[Clubs].[ClubID]) AS AwayClub
INTO #TemporaryTABLE1
FROM [Sport].[dbo].[Matches]
JOIN [Sport].[dbo].[Clubs] ON [Sport].[dbo].[Matches].[HomeClubID] = [Sport].[dbo].[Clubs].[ClubID] 

SELECT *
FROM #TemporaryTABLE1
WHERE HomeClub LIKE AwayClub

SELECT DISTINCT HomeClub
FROM #TemporaryTABLE1
WHERE HomeClub IN (SELECT DISTINCT AwayClub FROM #TemporaryTABLE1);

